OmniPaxos uses the slog crate to provide system wide logging facilities. Logging works out of the box with a default asynchronous console and file logger implementation that roughly corresponds to the following setup code: let path = std::path::Path::new(file_path);
let prefix = path.parent().unwrap();
std::fs::create_dir_all(prefix).unwrap(); let file = OpenOptions::new() .create(true) .write(true) .truncate(true) .open(file_path) .unwrap(); let term_decorator = slog_term::TermDecorator::new().build();
let file_decorator = slog_term::PlainSyncDecorator::new(file); let term_fuse = slog_term::FullFormat::new(term_decorator).build().fuse();
let file_fuse = slog_term::FullFormat::new(file_decorator).build().fuse(); let both = Mutex::new(slog::Duplicate::new(term_fuse, file_fuse)).fuse();
let both = slog_async::Async::new(both).build().fuse();
let logger = slog::Logger::root(both, o!()); The actual logging levels are controlled via build features. The default features correspond to max_level_trace and release_max_level_info, that is in debug builds all levels are shown, while in the release profile only info and more severe message are shown.

