Sometimes the default logging configuration is not sufficient for a particular application. For example, you might need a larger queue size in the Async drain, or you may want to write to a file instead of the terminal. In the following example we replace the default terminal logger with a file logger, logging to /tmp/myloggingfile instead. We also increase the queue size in the Async drain to 2048, so that it fits the 2048 logging events we are sending it short succession later. In order to replace the default logger, we give the logger as an argument to the OmniPaxos constructor. let logger = { let file = OpenOptions::new() .create(true) .write(true) .truncate(true) .open(FILE_NAME) .expect("logging file"); // create logger let decorator = slog_term::PlainSyncDecorator::new(file); let drain = slog_term::FullFormat::new(decorator).build().fuse(); let drain = slog_async::Async::new(drain).chan_size(2048).build().fuse(); slog::Logger::root_typed( Arc::new(drain), o!( "location" => slog::PushFnValue(|r: &slog::Record<'_>, ser: slog::PushFnValueSerializer<'_>| { ser.emit(format_args!("{}:{}", r.file(), r.line())) })), )
}; let replica = OmniPaxos::with( 1, pid, peer_pids, Storage::with( MemorySequence::<Ballot>::new(), MemoryState::<Ballot>::new(), ), None, logger, None,
), Note: The custom logger can be created for the Ballot Leader Election module as well.

